import React from "react";
import ReactDOM from "react-dom/client"; // React 18+ needs "client"
import App from "./App";
import { CustomThemeProvider } from "./ThemeContext";


ReactDOM.render(
  <CustomThemeProvider>
    <App />
  </CustomThemeProvider>,
  document.getElementById("root")
);
